import React from "react";

import "./Actions.css";
import {Button} from "../button/Button";

const Actions = () => {
	return (
		<div className="actions">
			<Button></Button>
			<div>Login</div>
			<div>Sign Up</div>
			<div>Profile</div>
		</div>
	);
};

export default Actions;
